import './App.css'
import Navbar from './components/Navbar'
import HomeView from './components/HomeView'
import AboutView from './components/AboutView'

function App() {
  return (
    <div className="App">
      <Switch>
        <Router path="/" exact>
          <HomeView />
        </Router>
      </Switch>
      <Navbar />
      <AboutView />
    </div>
  );
}

export default App;
